import React, { useState, useEffect } from "react";
import { APIProvider, Map } from '@vis.gl/react-google-maps';
import { Link } from "react-router-dom";
import logo from './logo.png'; 

const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

const Dashboard = () => {
    const [height, setHeight] = useState(0); // Height state

    useEffect(() => {
        const column2 = document.getElementById('column_two');
        if (column2) {
            setHeight(column2.offsetHeight);
        }
    }, []);

    return (
        <APIProvider apiKey={"YOUR_API_KEY"}>
            <div style={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
                <nav style={{ backgroundColor: '#333', color: '#fff', padding: '10px' }}>
                    <div className="logo">
                        <img src={logo} alt="Logo" width="100" height="100" />
                    </div>
                    <Link to="/Home"><b>Home</b></Link>
                    <Link to="/Dashboard"><b>Dashboard</b></Link>
                    <Link to="/Profile"><b>Profile</b></Link>
                    <Link to="/Reservations"><b>Reservations</b></Link>
                </nav>

                <div style={{ flex: 1 }}>
                    <article style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: `calc(100vh - ${height}px)` }}>
                        <div className="fl w-80 bg-light-gray" id="column_two" style={{ flexGrow: 1 }}>
                            <article>
                                <div>
                                    <h1 className="mt0">Accommodations</h1>
                                    <div style={{ height: '50vh' }}>
                                        <Map defaultCenter={position} defaultZoom={12} style={{ width: '100%', height: '100%' }} />
                                    </div>
                                </div>
                            </article>
                        </div>
                    </article>
                </div>

                <footer style={{ backgroundColor: '#333', color: '#fff', padding: '10px', textAlign: 'center' }}>
                    <small>Â© Created by Group CC, All Rights Reserved.</small>
                </footer>
            </div>
        </APIProvider>
    );
}

export default Dashboard;
